Compounds of the formula

    wherein 
   X is -O- or -CH₂-; 
   Y is -O-, -CH₂-CH₂-, -CH=CH-, -C≡C- or -OCH₂C₆H₄-; 
   Z is -CH₂-CH₂-, -CH=CH- or -C≡C-; 
   R¹ is hydrogen, lower alkyl, lower alkenyl, cycloalkyl or aralkyl; 
   A is -B or -O-B; 
   B is a mono-, di- or tricyclic aromatic or heteroaromatic moiety substituted by the group -COR², -(O) t -(W) s -COR²or -(CH=CH) p COR² and which may also contain up to 4 additional substituents selected, independently, from the group consisting of halogen, cyano, lower alkyl, lower alkoxy, sulfonamido, alkanoyl, aroyl, -(Q) k -(W) s' -E or -(Q) k -(W) s'' - 
   C₆H₄-(W) s''' -E, provided that no more than one of said substituents is -(Q) k -(W) s' -E or -(Q) k -(W) s'' -C₆H₄-(W) s''' -E; 
   E is -COR² or R²; 
   W is -CR³R⁴-; 
   Q is -O- or carbonyl; 
   R² is hydroxy, lower alkoxy or -NR³R⁴; 
   R³ and R⁴ , each occurence, independently, are hydrogen or lower alkyl; 
   f, h, k, m and t, independently, are 0 or 1; 
   n, s and s', independently, are an integer from 1 to 12; 
   p is an integer from 1 to 2; 
   s'' and s''', independently, are a integer from 0 to 12; and 
   C₆H₄ is a 1,2-, 1,3- or 1,4-phenylene moiety, 
their geometric and optical isomers and, when R² hydroxy, pharmaceutically acceptable salts thereof with bases are potent leukotriene B₄ antagonists and are therefore useful in the treatment of inflammatory diseases, such as psoriasis, inflammatory bowel diseases, asthma, allergy, arthritis, dermatitis, gout, pulmonary disease, ischemia/reperfusion injury, and trauma induced inflammation, such as spinal cord injury.
